 INSERT INTO srdb.assessment VALUES('DFO-QUE-HERR4RFA-1971-2003-PREFONTAINE', 'DFO-QUE', 'HERR4RFA', 'PREFONTAINE', '2008-06-05', '2011-06-14 14:16:09', '1971-2003', 'http://www.dfo-mpo.gc.ca/csas/csas/Publications/Pub_Index_e.htm', 'contact details ', 'This assessment is for the fall spawing stock of herring. The data for maturity at age was taken from the purse-seine fishery landings from April-June (second quarter). The SPA bias was adjusted by a bootstrap analysis; the biomass and abundance numbers for 2003 and 2004 were calculated from the mean recruitment attributed to age 2 of year-classes 2001 and 2002.', '', 1, 1, 'SPA-ADAPT', 'no comments', '../spreadsheets/PREFONTAINE-HERR4RFA-2004-editedRP-QAQC.xls', '999') ; 
